import Link from 'next/link';

const Card = (props) => {

  const { heading, link, text } = props;

  return(
    <div>
      <Link href={link}>
      <a>
      <h3 class="font-mono text-lg text-gray-800 text-center border-gray-600 border">{heading}</h3>
        <div class="font-mono text-lg text-gray-800 text-center">
          {text}
        </div>
     </a>
     </Link>

    </div>
  )
}

export default Card;
